// Header.js
import React from 'react';
import { Link } from 'react-router-dom';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faFacebook, faInstagram, faYoutube } from '@fortawesome/free-brands-svg-icons';
import './Header.css';

const Header = () => {
    return (
        <header className="header">
        <div className="logo">
            <Link to="/">Travel Uttarakhand</Link> {/* Replace with your logo image if needed */}
        </div>
        <nav className="nav">
            <ul>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/about">About</Link></li>
            <li><Link to="/services">Services</Link></li>
            <li><Link to="/contact">Contact</Link></li>
            </ul>
        </nav>
        <div className="social-media">
            <a href="https://www.facebook.com/TravelUttarakhandOfficial/" aria-label="Facebook"><FontAwesomeIcon icon={faFacebook} /></a>
            <a href="https://www.instagram.com/traveluttarakhandofficial/" aria-label="Instagram"><FontAwesomeIcon icon={faInstagram} /></a>
            <a href="https://youtube.com/@traveluttarakhand?si=6f1D_OQqH0KOusad" aria-label="YouTube"><FontAwesomeIcon icon={faYoutube} style={{ height }} /></a>
        </div>
        </header>
    );
};

export default Header;
